import Duration from "./duration";
import { useNavigate } from "react-router-dom";
export default function Matches(props){
    const navigate=useNavigate();
    const handleClick=()=>{
        navigate("/players")
    }
    return(
    <div className="frame" onClick={handleClick}>
        
       <div className="format-div">  <p className="format">{props.format}  </p></div>
       <div className="match-div"> <div className="logo-div"><img  alt={props.team1logo} className="teamlogo" src={props.team1logo}></img></div><p className="match">{props.teamA}  </p>
        <span>Vs</span><div className="match">{props.teamB}</div><div className="logo-div"><img className="team-logo" src={props.team2logo}></img></div></div>
       <div className="time-div"><Duration className="time" timings={props.timings}/></div>
       <div className="venue-div"><p className="venue">{props.venue} </p></div>
   </div>
    )
}
